import React from "react";
const grid = [];

for (let i = 0; i < 10; i++) grid.push(Array.from(Array(10), () => 0));

export default function EnemyGrid(gridSize) {
  function generateGridDivs() {
    const gridDivs = [];
    grid.forEach((row, i) => {
      row.forEach((col, j) => {
        gridDivs.push(
          <div
            className="spot"
            key={`${i}-${j}`}

            onDrop={(e) => handleDrop(e, i, j)}
          ></div>
        );
      });
    });
    return gridDivs;
  }
  return <div className="GridContainer">{generateGridDivs()}</div>;
}
